import React from 'react'
import ScoreTable from './ScoreTable'
import '../Style/GameStyel.css'
import Pentagon from "../images/bg-triangle.svg";
import Close from '../images/icon-close.svg'
export default function Game() {

  return (
    <div className="game_dashboard">
      <div className="score_table"> <ScoreTable/></div>
      <div className="triangle"> <img src={Pentagon}/></div>
      <div></div>
    </div>
  )
}
